/*
Chat component for the chat application
*/

import "./chat.css";

function Chat(props) {
  const { username, country, chat } = props;
  return (
    <div>
      <div className="container">
        <div className="item users">
          <div className="user-list-parent">
            <h2 className="users-header">Users()</h2>
            <p className="users-list">user list</p>
          </div>
          <button id="leave-button">Leave Chat</button>
        </div>
        <div className="item chat">Chat</div>
        <div className="item chart">Chart</div>
      </div>
    </div>
  );
}

export { Chat };
